 data_al['xm']\n    var ym = data_al['ym']\n    \n    // label at little circle:\n    var x_lbl = data_lb['x']\n    var y_lbl = data_lb['y']\n\n    // CS green:\n    var EX = data_al['EX']\n    var EY = data_al['EY']\n    \n    // CS blue:\n    var ex = data_al['ex']\n    var ey = data_al['ey']\n\n    // Eigen:\n    var evx = data_al['evx']\n    var evy = data_al['evy']\n    var start = data_al['start']\n    var end = data_al['end']\n    var minx = data_al['minx']\n    var phi1 = data_al['phi1']\n    var phi1deg = data_al['phi1deg']\n    var phi12deg = data_al['phi12deg']                \n    phi1 = Math.atan2(vy_tmp,vx_tmp)\n\n    // AnnularWedge blue:\n    var pa = data_al['pa']\n    var pad = data_al['pad']\n    var pad2 = data_al['pad2']\n    var px = data_al['px']\n\n    // AnnularWedge red :\n    var outer_radius = data_al['outer_radius']\n    var inner_radius = data_al['inner_radius']\n\n    // var start_angle = data_al['start_angle']\n    // var end_angle = data_al['end_angle']\n\n    if ( phi &gt;= 0.0 ){\n        var start_angle = data_al['start_angle']\n        var end_angle = data_al['end_angle']\n    }\n    else {\n        var start_angle = data_al['end_angle']\n        var end_angle = data_al['start_angle']\n    }\n\n    // console.log(cntdir)\n\n    // -----------------------------------------\n    // -----------------------------------------\n    // -----------------------------------------\n\n    // Multiline cyan:\n    for (var i = 0; i &lt; C.length; i++) {\n        X[i] =   vx*C[i] + vy*S[i];\n        Y[i] = - vx*S[i] + vy*C[i];\n    }\n    for (var i = 0; i &lt; XS.length-1; i++) {\n        XS[i] = [X[i],X[i+1]];\n        YS[i] = [Y[i],Y[i+1]];\n    }\n    var i_last = XS.length - 1;\n    XS[i_last] = [X[i_last],X[0]];\n    YS[i_last] = [Y[i_last],Y[0]];\n\n    // Little Circle black:\n    var dMP = [vx, vy]\n    var dMPm = [-vx, -vy]\n    phi *= Math.PI/180\n    var psi = - phi\n\n    var c1 = Math.cos(psi)\n    var s1 = Math.sin(psi)\n    var  phi;\n        pa[0] = 0.;\n        pad[0] = phi*180./Math.PI;\n        pad2[0] = 2*pad[0]\n    }\n\n    // AnnularWedge red:\n    inner_radius[0] = outer_radius[0]/3.5;\n    start_angle[0] = Math.atan2(vy,vx);\n    end_angle[0] = start_angle - phi;\n\n\n    src_al.change.emit();\n    src_ml.change.emit();\n    src_lb.change.emit();\n"}}]]]},"width":100,"title":"vx","value":3,"step":0.1}}]}},{"type":"object","name":"Row","id":"8a235480-1549-4a53-be70-d195631a5a78","attributes":{"sizing_mode":"stretch_width","children":[{"id":"93cf0a3f-24b8-4150-a608-49a48f2e0ad5"}]}},{"type":"object","name":"Row","id":"0d97abf8-99ad-417d-9272-65e6ba46d2d5","attributes":{"sizing_mode":"stretch_width","children":[{"id":"c7946fd7-a185-4e29-b18f-2e05f7429729"}]}},{"type":"object","name":"Row","id":"89342f8a-a633-40ac-bc1c-b9e4243d89b2","attributes":{"sizing_mode":"stretch_width","children":[{"type":"object","name":"CheckboxGroup","id":"5b1167bf-d869-4a4f-ade0-07809a1a5e4d","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:active",[{"type":"object","name":"CustomJS","id":"240ff318-fb07-431b-9467-ebc34e8fb140","attributes":{"args":{"type":"map","entries":[["src_al",{"id":"6db7a353-f073-4bbe-bfcd-06f60a21ddc3"}]]},"code":"\n    var data_al = src_al.data;\n    var a0 = data_al[\"alpha_0\"]                   \n    var a1 = data_al[\"alpha_1\"]                   \n    var a2 = data_al[\"alpha_2\"]                   \n    var a3 = data_al[\"alpha_3\"]                   \n\n    console.log('cb: ' + this.active)\n\n    if (this.active.includes(0)) {\n        a0[0] = 1.0\n        }\n    else {\n        a0[0] = 0.0\n    }\n    if (this.active.includes(1)) {\n        a1[0] = 1.0\n        }\n    else {\n        a1[0] = 0.0\n    }                               \n    if (this.active.includes(2)) {\n        a2[0] = 1.0\n        }\n    else {\n        a2[0] = 0.0\n    }                                             \n    if (this.active.includes(3)) {\n        a3[0] = 1.0\n        }\
